import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from './pages/home';
import Ambient from './pages/ambient';
import Focus from './pages/focus';
import Settings from './components/Settings';

const AppRoutes = ({ selectedBackground, handleBackgroundChange }) => {
  return (
    <Routes>
      <Route path="/" element={<Home selectedBackground={selectedBackground} />} />
      <Route path="ambient" element={<Ambient />} />
      <Route path="focus" element={<Focus />} />
      <Route path="settings" element={<Settings handleBackgroundChange={handleBackgroundChange} />} />
    </Routes>
  );
}

export default AppRoutes;
